import './App.css';

import React, { Component, useState, useEffect } from 'react';
import axios from 'axios';

import Calendar from './components/calendar';
import SearchBar from './components/searchBar';
import Tabs from './components/tabs';
import Tab from './components/tab';
import MainBody from './components/mainBody';



function App() {

  return (
    <div className="App" class="flex-container-html">

        <div class="flex-item-html flex-item-html-1 flex-container-searchAndTabs">

          <div class="flex-item-searchAndTabs flex-item-searchAndTabs-1 flex-container-searchBar">
            <SearchBar />
          </div>
          <div class="flex-item-searchAndTabs flex-item-searchAndTabs-2 flex-container-tabs">
            <Tabs />
          </div>

        </div>

        <div class="flex-item-html flex-item-html-2 flex-container-calendar">
            <Calendar />
        </div>

    </div>
  );


}

export default App;
